export default {
  model: { event: 'change', prop: 'value' },
  props: {
    clearable: {
      type: Boolean,
      default: true
    },
    placeholder: {
      type: String,
      default: '输入'
    },
    size: {
      type: String,
      default: 'mini'
    },
    value: {
      type: Array,
      default() {
        return []
      }
    }
  },
  computed: {
    min: {
      get: function() {
        return this.value[0]
      },
      set: function(val) {
        const data = JSON.parse(JSON.stringify(this.value))
        data[0] = val.replace(/[^\d.]/g, '')
        this.$emit('change', data)
      }
    },
    max: {
      get: function() {
        return this.value[1]
      },
      set: function(val) {
        const data = JSON.parse(JSON.stringify(this.value))
        data[1] = val.replace(/[^\d.]/g, '')
        this.$emit('change', data)
      }
    }
  }
}
